import { useState } from "react";
import {
  getRegularShiftByUserId,
  requestAvailability,
  requestTimeOff,
  cancelTimeOff,
  checkIn,
  checkOut
} from "../../api/peopleApi";

const DAYS = [
  "Sunday","Monday","Tuesday",
  "Wednesday","Thursday","Friday","Saturday"
];

function StaffDashboard() {
  const [userId, setUserId] = useState("");

  const [regular, setRegular] = useState([]);
  const [availability, setAvailability] = useState([]);
  const [timeOff, setTimeOff] = useState([]);
  const [workHours, setWorkHours] = useState([]);

  const [date, setDate] = useState("");
  const [start, setStart] = useState("");
  const [end, setEnd] = useState("");

  /* ================= LOAD ================= */
  const loadSchedule = async () => {
    if (!userId) return;

    const data = await getRegularShiftByUserId(userId);
    setRegular(Array.isArray(data) ? data : []);
  };

  /* ================= ACTIONS ================= */
  const handleAvailability = async () => {
    await requestAvailability(userId, date, start, end);
    setAvailability(prev => [
      ...prev,
      { date, start, end, approved: false }
    ]);
  };

  const handleTimeOff = async () => {
    await requestTimeOff(userId, date, start, end);
    setTimeOff(prev => [
      ...prev,
      { date, start, end, approved: false }
    ]);
  };

  const handleCheckIn = async () => {
    await checkIn(userId);
    setWorkHours(prev => [
      ...prev,
      { date: new Date().toISOString().slice(0,10), checkIn: "NOW", checkOut: "-" }
    ]);
  };

  const handleCheckOut = async () => {
    await checkOut(userId);
    setWorkHours(prev =>
      prev.map((w, i) =>
        i === prev.length - 1 ? { ...w, checkOut: "NOW" } : w
      )
    );
  };

  return (
    <div style={{ maxWidth: 1200 }}>
      <h2>üë∑ Staff Dashboard</h2>

      <input
        placeholder="User ID"
        value={userId}
        onChange={e => setUserId(e.target.value)}
      />
      <button onClick={loadSchedule}>Load All</button>

      {/* ===== REGULAR SHIFTS ===== */}
      <h3>üîÅ Regular Shifts</h3>
      <table border="1" width="100%">
        <thead>
          <tr><th>Day</th><th>Start</th><th>End</th></tr>
        </thead>
        <tbody>
          {regular.map((r,i)=>(
            <tr key={i}>
              <td>{DAYS[r.dayOfWeek]}</td>
              <td>{r.startTime}</td>
              <td>{r.endTime}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* ===== AVAILABILITY ===== */}
      <h3>üïí Availability</h3>
      <button onClick={handleAvailability}>Add Availability</button>
      <ul>
        {availability.map((a,i)=>(
          <li key={i}>{a.date} {a.start}-{a.end}</li>
        ))}
      </ul>

      {/* ===== TIME OFF ===== */}
      <h3>üõë Time Off</h3>
      <button onClick={handleTimeOff}>Request Time Off</button>
      <ul>
        {timeOff.map((t,i)=>(
          <li key={i}>{t.date} {t.start}-{t.end}</li>
        ))}
      </ul>

      {/* ===== WORK HOURS ===== */}
      <h3>‚è±Ô∏è Work Hours</h3>
      <button onClick={handleCheckIn}>Check In</button>
      <button onClick={handleCheckOut}>Check Out</button>
      <ul>
        {workHours.map((w,i)=>(
          <li key={i}>{w.date} | In: {w.checkIn} | Out: {w.checkOut}</li>
        ))}
      </ul>

      {/* ===== FORM ===== */}
      <h3>üìÖ Form</h3>
      <input type="date" onChange={e=>setDate(e.target.value)} />
      <input type="time" onChange={e=>setStart(e.target.value)} />
      <input type="time" onChange={e=>setEnd(e.target.value)} />
    </div>
  );
}

export default StaffDashboard;
